  CheckCircle as CheckCircleIcon,
  CreditCard as CreditCardIcon,
  Timeline as TimelineIcon,
} from '@mui/icons-material';
import axios from 'axios';
import { API_ENDPOINTS, getAuthHeader } from '../config';

const Users = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [openDialog, setOpenDialog] = useState(false);
  const [openDetailDialog, setOpenDetailDialog] = useState(false);
  const [editMode, setEditMode] = useState(false);
  const [userDetails, setUserDetails] = useState(null);
  const [userStats, setUserStats] = useState(null);
  const [detailsLoading, setDetailsLoading] = useState(false);
  const [currentUser, setCurrentUser] = useState({
    fullName: '',
    email: '',
    phoneNumber: '',
    role: 'user',
  });

  useEffect(() => {
    const fetchUsers = async () => {
      try {
        setLoading(true);
        const response = await axios.get(API_ENDPOINTS.USERS.LIST);
        console.log('Users response:', response.data);
        setUsers(response.data.data?.users || response.data.data || []);
        setError('');
      } catch (err) {
        setError('Không thể tải danh sách người dùng');
        console.error('Error fetching users:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchUsers();
  }, []);

  // Mở dialog chi tiết
  const handleOpenDetails = async (user) => {
    setDetailsLoading(true);
    setOpenDetailDialog(true);
    setUserDetails(null);
    setUserStats(null);

    try {
      // Fetch thông tin chi tiết người dùng
      const userResponse = await axios.get(
        API_ENDPOINTS.USERS.DETAIL(user._id),
        getAuthHeader()
      );

      // Fetch thông tin wallet
      const walletResponse = await axios.get(
        API_ENDPOINTS.USERS.WALLET(user._id),
        getAuthHeader()
      );

      // Fetch thống kê booking
      const statsResponse = await axios.get(
        API_ENDPOINTS.USERS.BOOKING_STATS(user._id),
        getAuthHeader()
      );

      setUserDetails({
        ...userResponse.data.data,
        walletInfo: walletResponse.data.data,
      });
      setUserStats(statsResponse.data.data);
    } catch (err) {
      setError('Không thể tải thông tin chi tiết người dùng');
      console.error('Error fetching user details:', err);
    } finally {
      setDetailsLoading(false);
    }
  };

  // Mở dialog chỉnh sửa
  const handleOpenEdit = (user) => {
    setEditMode(true);
    setCurrentUser({
      ...user,
    });
    setOpenDialog(true);
  };

  // Đóng dialog
  const handleCloseDialog = () => {
    setOpenDialog(false);
    setError('');
    setSuccess('');
  };

  // Xử lý thay đổi input
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCurrentUser((prev) => ({
      ...prev,
      [name]: value,
    }));
  };

  // Lưu người dùng (chỉ sửa)
  const handleSave = async () => {
    try {
      // Validate dữ liệu
      if (!currentUser.fullName || !currentUser.email || !currentUser.phoneNumber) {
        setError('Vui lòng điền đầy đủ thông tin bắt buộc');
        return;
      }

      // Chuẩn bị dữ liệu (không gửi password khi edit)
      const userData = {
        fullName: currentUser.fullName.trim(),
        email: currentUser.email.trim(),
        phoneNumber: currentUser.phoneNumber.trim(),
        role: currentUser.role,
      };

      console.log('Sending user data:', userData);

      // Chỉ cập nhật (không có thêm mới)
      await axios.put(
        API_ENDPOINTS.USERS.DETAIL(currentUser._id),
        userData
      );
      setSuccess('Cập nhật người dùng thành công!');

      // Refresh danh sách
      const response = await axios.get(API_ENDPOINTS.USERS.LIST);
      setUsers(response.data.data?.users || response.data.data || []);

      setTimeout(() => {
        handleCloseDialog();
        setSuccess('');
      }, 1500);
    } catch (err) {
      const errorMsg = err.response?.data?.message || err.message || 'Có lỗi xảy ra';
      setError(errorMsg);
      console.error('Error saving user:', err.response?.data || err);
    }
  };

  // Xóa người dùng
  const handleDelete = async (id) => {
    if (window.confirm('Bạn có chắc muốn xóa người dùng này?')) {
      try {
        await axios.delete(
          API_ENDPOINTS.USERS.DETAIL(id)
        );
        setSuccess('Xóa người dùng thành công!');
        // Refresh danh sách
        const response = await axios.get(API_ENDPOINTS.USERS.LIST);
        setUsers(response.data.data?.users || response.data.data || []);
        setTimeout(() => setSuccess(''), 3000);
      } catch (err) {
        setError(err.response?.data?.message || 'Không thể xóa người dùng');
        console.error('Error deleting user:', err);
      }
    }
  };

  // Format ngày giờ
  const formatDateTime = (dateTime) => {
    return new Date(dateTime).toLocaleString('vi-VN', {
      year: 'numeric',
      month: '2-digit',
      day: '2-digit',
      hour: '2-digit',
      minute: '2-digit',
    });
  };

  // Lấy chữ cái đầu tiên để hiển thị avatar
  const getInitials = (name) => {
    if (!name) return 'U';
    return name.split(' ').map(n => n[0]).join('').toUpperCase().slice(0, 2);
  };

  // Tính điểm loyalty từ totalSpentInWallet
  const calculateLoyaltyPoints = (totalSpent) => {
    if (!totalSpent) return 0;
    return Math.floor(totalSpent / 1000);
  };

  // Lấy tên hạng thành viên từ walletLevel
  const getMembershipTierName = (walletLevel) => {
    if (!walletLevel) return 'Đồng';
    switch (walletLevel.toLowerCase()) {
      case 'diamond': return 'Kim cương';
      case 'gold': return 'Vàng';
      case 'silver': return 'Bạc';
      case 'bronze': return 'Đồng';
      default: return 'Đồng';
    }
  };

  // Lấy màu cho hạng thành viên
  const getMembershipColor = (walletLevel) => {
    if (!walletLevel) return '#CD7F32';
    switch (walletLevel.toLowerCase()) {
      case 'diamond': return '#E8E8E8';
      case 'gold': return '#FFD700';
      case 'silver': return '#C0C0C0';
      case 'bronze': return '#CD7F32';
      default: return '#C0C0C0';
    }
  };

  if (loading) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="400px">
        <Typography>Loading...</Typography>
      </Box>
    );
  }

  return (
    <Box>
      <Box display="flex" justifyContent="flex-start" alignItems="center" mb={3}>
        <Typography variant="h4" component="h1">
          <PeopleIcon sx={{ mr: 1, verticalAlign: 'middle' }} />
          Quản lý người dùng
        </Typography>
      </Box>

      {error && (
        <Alert severity="error" sx={{ mb: 2 }} onClose={() => setError('')}>
          {error}
        </Alert>
      )}

      {success && (
        <Alert severity="success" sx={{ mb: 2 }} onClose={() => setSuccess('')}>
          {success}
        </Alert>
      )}

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell><strong>Avatar</strong></TableCell>
              <TableCell><strong>Tên</strong></TableCell>
              <TableCell><strong>Email</strong></TableCell>
              <TableCell><strong>SĐT</strong></TableCell>
              <TableCell><strong>Vai trò</strong></TableCell>
              <TableCell><strong>Ngày đăng ký</strong></TableCell>
              <TableCell><strong>Trạng thái</strong></TableCell>
              <TableCell align="center"><strong>Thao tác</strong></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {users.length === 0 ? (
              <TableRow>
                <TableCell colSpan={8} align="center">
                  Chưa có người dùng nào
                </TableCell>
              </TableRow>
            ) : (
              users.map((user) => (
                <TableRow key={user._id} hover>
                  <TableCell>
                    <Avatar sx={{ bgcolor: 'primary.main' }}>
                      {getInitials(user.fullName || user.name)}
                    </Avatar>
                  </TableCell>
                  <TableCell>{user.fullName || user.name || 'N/A'}</TableCell>
                  <TableCell>{user.email}</TableCell>
                  <TableCell>{user.phoneNumber || 'N/A'}</TableCell>
                  <TableCell>
                    <Chip
                      label={user.role === 'admin' ? 'Quản trị' : 'Người dùng'}
                      color={user.role === 'admin' ? 'primary' : 'default'}
                      size="small"
                    />
                  </TableCell>
                  <TableCell>{formatDateTime(user.createdAt)}</TableCell>
                  <TableCell>
                    <Chip
                      label="Đang hoạt động"
                      color="success"
                      size="small"
                    />
                  </TableCell>
                  <TableCell align="center">
                    <IconButton
                      color="info"
                      size="small"
                      onClick={() => handleOpenDetails(user)}
                      title="Xem chi tiết"
                    >
                      <VisibilityIcon />
                    </IconButton>
                    <IconButton
                      color="primary"
                      size="small"
                      onClick={() => handleOpenEdit(user)}
                      title="Chỉnh sửa"
                    >
                      <EditIcon />
                    </IconButton>
                    <IconButton
                      color="error"
                      size="small"
                      onClick={() => handleDelete(user._id)}
                      disabled={user.role === 'admin'}
                      title="Xóa"
                    >
                      <DeleteIcon />
                    </IconButton>
                  </TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>

      <Box mt={2}>
        <Typography variant="body2" color="textSecondary">
          Tổng số người dùng: <strong>{users.length}</strong>
        </Typography>
      </Box>

      {/* Dialog chỉnh sửa */}
      <Dialog open={openDialog} onClose={handleCloseDialog} maxWidth="md" fullWidth>
        <DialogTitle>
          Chỉnh sửa người dùng
        </DialogTitle>
        <DialogContent>
          {error && (
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          )}
          {success && (
            <Alert severity="success" sx={{ mb: 2 }}>
              {success}
            </Alert>
          )}
          <Box sx={{ display: 'grid', gap: 2, mt: 2 }}>
            <TextField
              label="Họ và tên"
              name="fullName"
              value={currentUser.fullName}
              onChange={handleInputChange}
              fullWidth
              required
            />
            <Box sx={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: 2 }}>
              <TextField
                label="Email"
                name="email"
                type="email"
                value={currentUser.email}
                onChange={handleInputChange}
                required
              />
              <TextField
                label="Số điện thoại"
                name="phoneNumber"
                value={currentUser.phoneNumber}
                onChange={handleInputChange}
                required
              />
            </Box>
            <TextField
              label="Vai trò"
              name="role"
              select
              value={currentUser.role}
              onChange={handleInputChange}
              required
            >
              <MenuItem value="user">Người dùng</MenuItem>
              <MenuItem value="admin">Quản trị</MenuItem>
            </TextField>
          </Box>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleCloseDialog}>Hủy</Button>
          <Button onClick={handleSave} variant="contained">
            Cập nhật
          </Button>
        </DialogActions>
      </Dialog>

      {/* Dialog chi tiết người dùng */}
      <Dialog
        open={openDetailDialog}
        onClose={handleCloseDetailDialog}
        maxWidth="lg"
        fullWidth
        PaperProps={{
          sx: { borderRadius: 2 }
        }}
      >
        <DialogTitle sx={{
          background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
          color: 'white',
          display: 'flex',
          alignItems: 'center',
          gap: 2,
          py: 3
        }}>
          <Avatar sx={{
            bgcolor: 'rgba(255, 255, 255, 0.2)',
            width: 56,
            height: 56,
            fontSize: '1.5rem'
          }}>
            {userDetails ? getInitials(userDetails.fullName) : 'U'}
          </Avatar>
          <Box>
            <Typography variant="h5" component="div" fontWeight="bold">
              {userDetails ? (userDetails.fullName || 'N/A') : 'Loading...'}
            </Typography>
            <Typography variant="body1" sx={{ opacity: 0.9 }}>
              {userDetails ? userDetails.email : ''}
            </Typography>
          </Box>
        </DialogTitle>

        <DialogContent sx={{ p: 3 }}>
          {error && (
            <Alert severity="error" sx={{ mb: 2 }}>
              {error}
            </Alert>
          )}

          {detailsLoading ? (
            <Box display="flex" justifyContent="center" alignItems="center" py={8}>
              <Typography>Đang tải thông tin...</Typography>
            </Box>
          ) : userDetails ? (
            <Grid container spacing={3}>
              {/* Thông tin cơ bản */}
              <Grid item xs={12} md={6}>
                <Card sx={{ height: '100%' }}>
                  <CardContent>
                    <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <PersonIcon color="primary" />
                      Thông tin cá nhân
                    </Typography>
                    <Divider sx={{ mb: 2 }} />

                    <List>
                      <ListItem>
                        <ListItemIcon>
                          <PersonIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Họ và tên"
                          secondary={userDetails.fullName || 'Chưa cập nhật'}
                        />
                      </ListItem>

                      <ListItem>
                        <ListItemIcon>
                          <EmailIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Email"
                          secondary={userDetails.email}
                        />
                      </ListItem>

                      <ListItem>
                        <ListItemIcon>
                          <PhoneIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Số điện thoại"
                          secondary={userDetails.phoneNumber || 'Chưa cập nhật'}
                        />
                      </ListItem>

                      <ListItem>
                        <ListItemIcon>
                          <DateIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Ngày đăng ký"
                          secondary={formatDateTime(userDetails.createdAt)}
                        />
                      </ListItem>
                    </List>
                  </CardContent>
                </Card>
              </Grid>

              {/* Thông tin ví điện tử */}
              <Grid item xs={12} md={6}>
                <Card sx={{ height: '100%' }}>
                  <CardContent>
                    <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                      <WalletIcon color="primary" />
                      Ví điện tử
                    </Typography>
                    <Divider sx={{ mb: 2 }} />

                    <List>
                      <ListItem>
                        <ListItemIcon>
                          <AccountBalanceWallet color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Số dư ví"
                          secondary={`${new Intl.NumberFormat('vi-VN', { style: 'currency', currency: 'VND' }).format(userDetails.walletInfo?.balance || 0)}`}
                        />
                      </ListItem>

                      <ListItem>
                        <ListItemIcon>
                          <StarIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Hạng thành viên"
                          secondary={
                            <Chip
                              label={getMembershipTierName(userDetails.walletInfo?.walletLevel)}
                              sx={{
                                bgcolor: getMembershipColor(userDetails.walletInfo?.walletLevel),
                                color: userDetails.walletInfo?.walletLevel === 'diamond' ? '#333' : 'white',
                                fontWeight: 'bold'
                              }}
                              size="small"
                            />
                          }
                        />
                      </ListItem>

                      <ListItem>
                        <ListItemIcon>
                          <TimelineIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Điểm loyalty"
                          secondary={`${calculateLoyaltyPoints(userDetails.walletInfo?.totalSpentInWallet).toLocaleString()} điểm`}
                        />
                      </ListItem>

                      <ListItem>
                        <ListItemIcon>
                          <CreditCardIcon color="action" />
                        </ListItemIcon>
                        <ListItemText
                          primary="Tổng chi tiêu"
                          secondary={`${new Intl.NumberFormat('vi-VN', { style: 'currency', currency: 'VND' }).format(userDetails.walletInfo?.totalSpentInWallet || 0)}`}
                        />
                      </ListItem>
                    </List>
                  </CardContent>
                </Card>
              </Grid>

              {/* Thống kê booking */}
              {userStats && (
                <Grid item xs={12}>
                  <Card>
                    <CardContent>
                      <Typography variant="h6" gutterBottom sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                        <TicketIcon color="primary" />
                        Thống kê đặt vé
                      </Typography>
                      <Divider sx={{ mb: 2 }} />

                      <Grid container spacing={2}>
                        <Grid item xs={6} sm={3}>
                          <Box textAlign="center" p={2} sx={{ bgcolor: 'primary.light', borderRadius: 2, color: 'white' }}>
                            <Typography variant="h4" fontWeight="bold">
                              {userStats.totalBookings || 0}
                            </Typography>
                            <Typography variant="body2">
                              Tổng vé đã đặt
                            </Typography>
                          </Box>
                        </Grid>

                        <Grid item xs={6} sm={3}>
                          <Box textAlign="center" p={2} sx={{ bgcolor: 'success.light', borderRadius: 2, color: 'white' }}>
                            <Typography variant="h4" fontWeight="bold">
                              {userStats.paidBookings || 0}
                            </Typography>
                            <Typography variant="body2">
                              <CheckCircleIcon sx={{ verticalAlign: 'middle', mr: 0.5 }} />
                              Đã thanh toán
                            </Typography>
                          </Box>
                        </Grid>

                        <Grid item xs={6} sm={3}>
                          <Box textAlign="center" p={2} sx={{ bgcolor: 'warning.light', borderRadius: 2, color: 'white' }}>
                            <Typography variant="h4" fontWeight="bold">
                              {userStats.pendingBookings || 0}
                            </Typography>
                            <Typography variant="body2">
                              ⏳ Chờ xử lý
                            </Typography>
                          </Box>
                        </Grid>

                        <Grid item xs={6} sm={3}>
                          <Box textAlign="center" p={2} sx={{ bgcolor: 'error.light', borderRadius: 2, color: 'white' }}>
                            <Typography variant="h4" fontWeight="bold">
                              {userStats.cancelledBookings || 0}
                            </Typography>
                            <Typography variant="body2">
                              <CancelIcon sx={{ verticalAlign: 'middle', mr: 0.5 }} />
                              Đã hủy
                            </Typography>
                          </Box>
                        </Grid>
                      </Grid>
                    </CardContent>
                  </Card>
                </Grid>
              )}
            </Grid>
          ) : null}
        </DialogContent>

        <DialogActions>
          <Button onClick={handleCloseDetailDialog}>
            Đóng
          </Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default Users;
